import React, { useState, useEffect } from "react";
import { BasicTable, Chart, InfoTable, ModalForm } from "./components"
import { infected } from "../../../../api/infected";

const Infected = () => {


    const [infectedPeople, setInfectedPeople] = useState();

    useEffect(() => {
        infected.getInfected().then((response) => {
            setInfectedPeople(response);
        })
    }, []);

    const COLUMNS = [
        {
            Header: 'Fecha contagio',
            accessor: 'infect_date'
        },
        {
            Header: 'Nombre',
            accessor: 'first_name',
        },
        {
            Header: 'Apellido',
            accessor: 'last_name',
        },
        {
            Header: 'Edad',
            accessor: 'age',
        },
        {
            Header: 'Pais',
            accessor: 'country',
        },
        {
            Header: 'Genero',
            accessor: 'female',
        }
    ]

    return (
        <div>
            {/* <BasicTable data={infectedPeople}
                columns={COLUMNS} /> */}
            <InfoTable />
            <ModalForm />
            <Chart data={infectedPeople} />
        </div>
    )
}

export { Infected }
